import React, {Component} from 'react';
import MainUI from './Components/MainUI';
import Interface from './Components/Interface';

import Modal from './Components/MainUI';


import './CSS/monkeypuzzle.css';
//import './CSS/font-awesome.min.css';
import './CSS/cytoscape-context-menus.css';
//import './CSS/jquery.qtip.min.css';
//import './CSS/bootstrap.min.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import './CSS/App.css';
import {Button} from 'react-bootstrap';


var FontAwesome = require('react-fontawesome');


const interfaceDivStyle = {
  marginLeft:'20px',
  marginRight:'60px'
}

const textAreaStyle = {
  resize: 'none'
}



class App extends Component{


  render(){

    return (
      <div className="App">
        <Interface />
        <MainUI />


      </div>
      );
  }
}






// change to stateless function component 
class MyButton extends Component {
  render(){
    const {
      onClick,
      className = '',
      children = '',
      title
    } = this.props;

    return (
       <button
        onClick={onClick}
        className={className}
        title={title}
        type="button"
      >
        {children}
      </button>
    );
  }
}









class TextArea extends Component {
  render(){
    const {
      className = '',
      title = '',
      placeholder,
      id,
      rows,
      cols,
      maxLength,
      onChange,
      children,
      style

    } = this.props;

    return (
      <textarea
      className={className}
      title={title}
      placeholder={placeholder}
      id={id}
      rows={rows}
      cols={cols}
      maxLength = {maxLength}
      onChange = {onChange}
      type="textarea"
      style={style}
      >
        {children}
      </textarea>
      );
  }
}





export default App;
